create table upazila_wise_khotian_and_map_reports
(
    id                int auto_increment
        primary key,
    division_bbs_code tinyint                             null,
    district_bbs_code tinyint                             null,
    upazila_bbs_code  tinyint                             null,
    division_name     varchar(255)                        null,
    district_name     varchar(255)                        null,
    upazila_name      varchar(255)                        null,
    total_khotian     int                                 null,
    total_map         int                                 null,
    created_at        timestamp default CURRENT_TIMESTAMP null,
    updated_at        timestamp                           null
);

